import './App.css';
import { Route, Routes } from "react-router-dom";
import Phones from './pages/Phones.js';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/phones" element={<Phones />} />
      </Routes>
    </div>
  );
}

export default App;
